import { Main,Table,CellHeader,Row,Cell } from "govuk-react";
function DoctorDashBoard() {
    
    return(
        <div>
<Main>

<Table
  caption="Three quarters, one quarter"
  head={<Table.Row><CellHeader setWidth="three-quarters">three-quarters</CellHeader><CellHeader setWidth="one-quarter">one-quarter</CellHeader></Table.Row>}
>
  <Table.Row>
    <Table.Cell>
      Column uses setWidth="three-quarters" in header
    </Table.Cell>
    <Table.Cell>
      setWidth="one-quarter"
    </Table.Cell>
  </Table.Row>
</Table>
</Main>

        </div>
    );
}
export default DoctorDashBoard;
